  and PROJECT_ID = #{projectId,jdbcType=VARCHAR}
  and QUESTIONNAIRE_ID = #{questionnaireId,jdbcType=VARCHAR}
  and QUESTIONSET_ID = #{questionsetId,jdbcType=VARCHAR}
  and QUESTION_ID = #{questionId,jdbcType=VARCHAR}

